  color: white;
  font-family: abcsans,-apple-system,BlinkMacSystemFont,Segoe UI,Roboto,Helvetica Neue,Arial,sans-serif;
}
.container {
  align-items: flex-end;
  display: flex;
  height: 27rem;
  max-width: 88rem;
  margin: 0 auto;
  overflow: hidden;
  position: relative;
}

.background-image {
  animation: zoom-out;
  animation-duration: 15s;
  background-size: cover;
  background-repeat: no-repeat;
  background-position: 50% 20%;
  height: 100%;
  left: 0;
  position: absolute;
  top: 0;
  width: 100%;
}

.image-overlay {
  background: radial-gradient(
    circle at bottom left,
    rgba(30, 33, 36, 1),
    rgba(30, 33, 36, 0.66) 33%,
    rgba(30, 33, 36, 0) 66%,
    rgba(30, 33, 36, 0) 100%
  );
  height: 100%;
  left: 0;
  position: absolute;
  top: 0;
  width: 100%;
  z-index: 0;
}

.content-container {
  align-items: flex-end;
  display: flex;
  height: 100%;
  position: relative;
  width: 100%;
  z-index: 1;
}

.content {
  padding: 1rem 1rem 1.5rem;

  @media (min-width: 544px) {
    padding-bottom: 2rem;
  }

  @media (min-width: 768px){
    padding-left: 2rem;
  }

}

.supheading {
  font-size: 0.875rem;
  text-transform: uppercase;
  margin: 0;
}

.title {
  margin-top: 0;
  margin-bottom: 0.25rem;
  text-transform: uppercase;
  font-size: 1.5rem;
  line-height: 2rem;

  @media (min-width: 768px){
    .title {
      font-size: 2.25rem;
      line-height: 2.5rem;    
    }
  }

}

.synopsis {
  margin: 0 0 1rem;
  font-weight: 400;
  font-size: 1rem;

  @media (min-width: 768px){
    .synopsis {
      font-size: 1.25rem;
      line-height: 1.5rem;     
    }
  }
}

.cta {
  align-items: center;
  display: inline-flex;
  margin: 0;
}

.cta-button {
  flex: none;
  color: black;
  box-shadow: 0 0 0 0 transparent,
    0 0.25rem 0.375rem -0.0625rem rgba(0, 0, 0, 0.1),
    0 0.125rem 0.25rem -0.0625rem rgba(0, 0, 0, 0.05);
  background-color: #fdc605;
  border-color: #fdc605;
  border-radius: 3px;
  display: inline-block;
  cursor: pointer;
  font-size: 0.75rem;
  font-weight: bold;
  margin: 0;
  text-align: center;
  vertical-align: middle;
  margin-right: 1rem;
  height: 3rem;
  display: flex;
  align-items: center;
  padding: 0 1rem;
  position: relative;
  text-decoration: none;
  letter-spacing: 0.125rem;
  text-transform: uppercase;
  transition: 0.2s;
  -webkit-font-smoothing: antialiased;
  z-index: 2;
}
.cta-button:hover {
  background-color: white;
  border-color: white;
  transform: scale(1.02);
}
.cta-button:visited {
  color: black;
}

.cover-link {
  height: 100%;
  left: 0;
  opacity: 0;
  position: absolute;
  top: 0;
  width: 100%;
  z-index: 1;
}

.logo {
  width: 7rem;
}

@keyframes zoom-out {
  from {
    transform: scale(1.1);
  }

  to {
    transform: scale(1);
  }
}
